class Command(BaseCommand):
    def handle(self, *args, **options):
        slot_start = 0
        slot_end = 1000
        current_timestamp = datetime.now().timestamp() * 1000
        count = 0

        while slot_end < 34000:
            slot = final_queryset[slot_start:slot_end]
            print(slot_start, slot_end)
            queryset = SurveyResponse.objects.filter(pk__in=slot)

            updatable_entries = []
            for q in queryset:
                q.last_updated = current_timestamp
                updatable_entries.append(q)
                current_timestamp += 1
                count += 1

            if len(updatable_entries) > 0:
                print("batch size: {0}, total updating {1} / {2}".format(len(updatable_entries), count, len(final_queryset)))
                SurveyResponse.objects.bulk_update(updatable_entries)
                print("updated....")

            slot_start += 1000
            slot_end += 1000
